import { useState } from 'react';
import axios from 'axios';
// import ReactDatePicker from 'react-datepicker';
import DatePicker from 'react-datepicker';
import { Link } from "react-router-dom";
import { useNavigate } from 'react-router-dom';
import Managerdropdown from './Managerdropdown';
function Assigntask(props) {
    const navigate = useNavigate();
    const [task, setTask] = useState(
        {

            taskName: "",
            description: "",
            dueDate: "",
            taskStatus: "",
            taskProgress: "",
            memailId:"",
        }
    )
    const { taskName, description,  dueDate, taskStatus , taskProgress,memailId } = leave
    const onInputChange = (e) => {
        setTask({
            ...task,
            [e.target.name]: e.target.value
        });
    }
    const handleSubmit = async (e) => {
        e.preventDefault();
        await axios.post(`http://localhost:9002/leave`, {

            "taskName": taskName,
            " description": description,
            " dueDate": dueDate,
            "taskStatus": taskStatus,
            "taskProgress": taskProgress,
            " memailId":memailId,
        }
        )
            .then(res => {
                console.log(res.data)
                if (res.status === 404) {
                    alert(res.data)
                }
            })
            .catch(error => {
                console.log(error)
            })
        navigate("/managerhome");

    };
    return (
        <div>
           <Managerdropdown></Managerdropdown>
            <div className="container">
                <div className="row">
                    <div className="col-md-6 offset-md-3 border rounded p-4 mt-2 shadow">
                        <h2 className="text-center m-4"> Assign Task</h2>
                        <form onSubmit={(e) => handleSubmit(e)}>
                            <div className="mb-3">
                                <label htmlFor="taskName" className="form-label">TaskName</label>
                                <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter your taskName"
                                    name="taskName"
                                    value={taskName}
                                    onChange={onInputChange}
                                ></input>
                            </div>
                            <div className="mb-3">
                                <label htmlFor="description" className="form-label">Manager EmailId</label>
                                <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter description"
                                    name="description"
                                    value={description}
                                    onChange={onInputChange}
                                ></input>
                            </div>
                            <div className="mb-3">
                                <label htmlFor="dueDate" className="form-label">dueDate</label>
                                <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter your Reason"
                                    name="dueDate"
                                    value={dueDate}
                                    onChange={onInputChange}
                                ></input>
                            </div>
                            <div className="mb-3">
                            <label htmlFor="fromDate" className="form-label">From Date</label>
                                <input
                                    type={"Date"}
                                    className="form-control"
                                    placeholder="Enter your Date"
                                    name="fromDate"
                                    value={fromDate}
                                    onChange={onInputChange}
                                ></input>
                               
                            </div>
                            <div className="mb-3">
                            <label htmlFor="toDate" className="form-label">To Date</label>
                                <input
                                    type={"Date"}
                                    className="form-control"
                                    placeholder="Enter your Date"
                                    name="toDate"
                                    value={toDate}
                                    onChange={onInputChange}
                                ></input>
                               
                            </div>
                            

                            <button type="submit" className="btn btn-outline-info">Submit</button>
                            {/* <Link to="/"type="submit" className="btn btn-success">Submit</Link> */}
                            
                        </form>
                    </div>

                </div>
            </div>
        </div>
    );
}

export default Assigntask;
